export default class ImageTextures {
  constructor (gl) {
    this.gl = gl;

    this.anisoExt = (
      this.gl.getExtension('EXT_texture_filter_anisotropic') ||
      this.gl.getExtension('MOZ_EXT_texture_filter_anisotropic') ||
      this.gl.getExtension('WEBKIT_EXT_texture_filter_anisotropic')
    );

    /* eslint-disable max-len */
    this.lichenImage = new Image();
    this.lichenImage.onload = () => {
      this.lichenTex = this.gl.createTexture();
      this.bindTexture(this.lichenTex, this.lichenImage, 256, 256);
    };
    this.lichenImage.src = 'data:image/jpeg;base64,';

    this.cloudImage = new Image();
    this.cloudImage.onload = () => {
      this.cloudTex = this.gl.createTexture();
      this.bindTexture(this.cloudTex, this.cloudImage, 128, 128);
    };
    this.cloudImage.src = 'data:image/jpeg;base64,';
    /* eslint-enable max-len */
  }

  bindTexture (texture, data, width, height) {
    this.gl.bindTexture(this.gl.TEXTURE_2D, texture);

    this.gl.pixelStorei(this.gl.UNPACK_ALIGNMENT, 1);
    this.gl.texImage2D(this.gl.TEXTURE_2D, 0, this.gl.RGBA, width, height, 0,
                       this.gl.RGBA, this.gl.UNSIGNED_BYTE, data);

    this.gl.generateMipmap(this.gl.TEXTURE_2D);

    this.gl.texParameteri(this.gl.TEXTURE_2D, this.gl.TEXTURE_WRAP_S, this.gl.REPEAT);
    this.gl.texParameteri(this.gl.TEXTURE_2D, this.gl.TEXTURE_WRAP_T, this.gl.REPEAT);
    this.gl.texParameteri(this.gl.TEXTURE_2D, this.gl.TEXTURE_MIN_FILTER,
                                              this.gl.LINEAR_MIPMAP_LINEAR);
    this.gl.texParameteri(this.gl.TEXTURE_2D, this.gl.TEXTURE_MAG_FILTER, this.gl.LINEAR);
    if (this.anisoExt) {
      const max = this.gl.getParameter(this.anisoExt.MAX_TEXTURE_MAX_ANISOTROPY_EXT);
      this.gl.texParameterf(this.gl.TEXTURE_2D, this.anisoExt.TEXTURE_MAX_ANISOTROPY_EXT, max);
    }
  }

  getTexture (sampler) {
    if (sampler === 'lichen') {
      return this.lichenTex;
    } else if (sampler === 'cloud') {
      return this.cloudTex;
    }

    return this.lichenTex;
  }
}
